Module.print = (function() {
    var element = document.getElementById('output');
    if (element) element.value = ''; // clear browser cache
    return function(text) {
        if (arguments.length > 1) text = Array.prototype.slice.call(arguments).join(' ');

        if (text.indexOf('C++') != -1) {
            setStatus('Generator loaded into memory.');
        }
        console.log(text);
    };
})();
Module.printErr = function(text) {
    if (arguments.length > 1) text = Array.prototype.slice.call(arguments).join(' ');
    console.error(text);
};
Module.setStatus = function(text) {
    if (!Module.setStatus.last) Module.setStatus.last = {
        time: Date.now(),
        text: ''
    };
    if (text === Module.setStatus.last.text) return;
    var m = text.match(/([^(]+)\((\d+(\.\d+)?)\/(\d+)\)/);
    var now = Date.now();
    if (m && now - Module.setStatus.last.time < 30) return;
    Module.setStatus.last.time = now;
    Module.setStatus.last.text = text;
};
Module.totalDependencies = 0;
Module.monitorRunDependencies = function(left) {
    this.totalDependencies = Math.max(this.totalDependencies, left);
    Module.setStatus(left ? 'Preparing... (' + (this.totalDependencies - left) + '/' + this.totalDependencies + ')' : 'All downloads complete.');
};
Module.setStatus('Downloading...');
window.onerror = function(event) {
    Module.setStatus('Exception thrown, see JavaScript console');
    Module.setStatus = function(text) {
        if (text) Module.printErr('[post-exception status] ' + text);
    };
};

function saveFileFromMemoryFSToDisk(memoryFSname, localFSname) {
    var data = FS.readFile(memoryFSname);
    var blob;
    var isSafari = /^((?!chrome|android).)*safari/i.test(navigator.userAgent);
    if (isSafari) {
        blob = new Blob([data.buffer], {
            type: "application/octet-stream"
        });
    } else {
        blob = new Blob([data.buffer], {
            type: "application/octet-binary"
        });
    }
    saveAs(blob, localFSname);
}

$(function(){
window.setStatus = function(t) {
    $("h1").text(t);
}
var multipleSupport = typeof $('<input/>')[0].multiple !== 'undefined',
    isIE = /msie/i.test(navigator.userAgent);

$.fn.customFile = function() {

    return this.each(function() {

        let text = $(this).data("text"),
            $file = $(this).addClass('custom-file-upload-hidden'), // the original file input
            $wrap = $('<div class="file-upload-wrapper">'),
            $input = $('<input type="text" class="file-upload-input" />'),
            // Button that will be used in non-IE browsers
            $button = $('<button type="button" class="file-upload-button">' + text + '</button>'),
            // Hack for IE
            $label = $('<label class="file-upload-button" for="' + $file[0].id + '">' + text + '</label>');

        // Hide by shifting to the left so we
        // can still trigger events
        $file.css({
            position: 'absolute',
            left: '-9999px'
        });

        $wrap.insertAfter($file)
            .append($file, $input, (isIE ? $label : $button));

        // Prevent focus
        $file.attr('tabIndex', -1);
        $button.attr('tabIndex', -1);

        $button.click(function() {
            $file.focus().click(); // Open dialog
        });

        $file.change(function() {

            var files = [],
                fileArr, filename;

            // If multiple is supported then extract
            // all filenames from the file array
            if (multipleSupport) {
                fileArr = $file[0].files;
                for (var i = 0, len = fileArr.length; i < len; i++) {
                    files.push(fileArr[i].name);
                }
                filename = files.join(', ');

                // If not supported then just take the value
                // and remove the path to just show the filename
            } else {
                filename = $file.val().split('\\').pop();
            }

            $input.val(filename) // Set the value
                .attr('title', filename) // Show filename in title tootlip
                .focus(); // Regain focus

            let idx = $("input[type=file]").index($file);
            let reader = new FileReader();
            reader.onload = function(e) {
                let imgData = e.target.result;
                let imgName = $file[0].files[0].name;
                // window.str = btoa(imgData);
                imgName = Math.round(Math.random() * 100) + imgName;
                FS.createDataFile(".", imgName, imgData, 1, 1, 1);
                setStatus('Processing image...');
                setTimeout(function() {
                    ccall('setImage', 'number', ['number', 'string'], [idx, imgName]);
                    setStatus('Ready')
                }, 0);
            };
            if($file[0].files.length) reader.readAsBinaryString($file[0].files[0]);
            else {
            	ccall('setImage', 'number', ['number', 'string'], [idx, '']);
            	setStatus('Set to default image.');
            }
        });

        $input.on({
            blur: function() {
                $file.trigger('blur');
            },
            keydown: function(e) {
                if (e.which === 13) { // Enter
                    if (!isIE) {
                        $file.trigger('click');
                    }
                } else if (e.which === 8 || e.which === 46) { // Backspace & Del
                    // On some browsers the value is read-only
                    // with this trick we remove the old input and add
                    // a clean clone with all the original events attached
                    $file.replaceWith($file = $file.clone(true));
                    $file.trigger('change');
                    $input.val('');
                } else if (e.which === 9) { // TAB
                    return;
                } else { // All other keys
                    return false;
                }
            }
        });

    });
};

// Old browser fallback
if (!multipleSupport) {
    $(document).on('change', 'input.customfile', function() {

        var $this = $(this),
            // Create a unique ID so we
            // can attach the label to the input
            uniqId = 'customfile_' + (new Date()).getTime(),
            $wrap = $this.parent(),

            // Filter empty input
            $inputs = $wrap.siblings().find('.file-upload-input')
            .filter(function() {
                return !this.value
            }),

            $file = $('<input type="file" id="' + uniqId + '" name="' + $this.attr('name') + '"/>');

        // 1ms timeout so it runs after all other events
        // that modify the value have triggered
        setTimeout(function() {
            // Add a new input
            if ($this.val()) {
                // Check for empty fields to prevent
                // creating new inputs when changing files
                if (!$inputs.length) {
                    $wrap.after($file);
                    $file.customFile();
                }
                // Remove and reorganize inputs
            } else {
                $inputs.parent().remove();
                // Move the input so it's always last on the list
                $wrap.appendTo($wrap.parent());
                $wrap.find('input').focus();
            }
        }, 1);

    });
}
$('input[type=file]').customFile();
});
